import React from "react";
import Calendar from '../components/Calendar';
import ContactPage from '../components/ContactPage';
import NonBusiness from '../components/nonbusinessenquires';
import { useTranslation } from 'react-i18next';

function Contact() {
    const { t } = useTranslation();
    return (
        <div>
            {/* ContactPage at the top */}
            <ContactPage />

            {/* Calendar and NonBusiness side by side */}
            <div style={styles.horizontalContainer}>
                <Calendar />
                <NonBusiness />
            </div>
        </div>
    );
}

// Styles for the component
const styles = {
    horizontalContainer: {
        display: 'flex', // Use Flexbox
        justifyContent: 'space-between', // Space between the two components
        alignItems: 'flex-start', // Align items at the top
        gap: '20px', // Add spacing between the components
        padding: '20px', // Add padding around the container
        maxWidth: '1200px', // Optional: Set a max width for the container
        margin: '0 auto', // Center the container
    },
};

export default Contact;
